(1, 3, 'department', 'Chemistry', 'chemistry', '<p>‡¶Ü‡¶®‡¶®‡ßç‡¶¶ ‡¶Æ‡ßá‡¶æ‡¶π‡¶® ‡¶ï‡¶≤‡ßá‡¶ú‡ßá‡¶∞ ‡¶∞‡¶∏‡¶æ‡ßü‡¶® ‡¶¨‡¶ø‡¶≠‡¶æ‡¶ó‡ßá‡¶∞ ‡¶™‡ßÇ‡¶∞‡ßç‡¶¨ ‡¶π‡¶§‡ßá ‡¶â‡¶ö‡ßç‡¶ö ‡¶Æ‡¶æ‡¶ß‡ßç‡¶Ø‡¶Æ‡¶ø‡¶ï ‡¶∂‡ßç‡¶∞‡ßá‡¶£‡¶ø‡¶§‡ßá ‡¶™‡¶æ‡¶†‡¶¶‡¶æ‡¶® ‡¶ï‡¶æ‡¶∞‡ßç‡¶Ø‡¶ï‡ßç‡¶∞‡¶Æ ‡¶ö‡¶æ‡¶≤‡ßÅ ‡¶õ‡¶ø‡¶≤‡•§ 1974 ‡¶∏‡¶æ‡¶≤‡ßá ‡¶¢‡¶æ‡¶ï‡¶æ ‡¶¨‡¶ø‡¶∂‡ßç‡¶¨‡¶¨‡¶ø‡¶¶‡ßç‡¶Ø‡¶æ‡¶≤‡ßü‡ßá‡¶∞ ‡¶Ö‡¶ß‡ßÄ‡¶®‡ßá ‡¶Ö‡¶§‡ßç‡¶∞ ‡¶ï‡¶≤‡ßá‡¶ú‡ßá ‡¶∏‡¶∞‡ßç‡¶¨ ‡¶™‡ßç‡¶∞‡¶•‡¶Æ ‡¶∞‡¶∏‡¶æ‡ßü‡¶® ‡¶¨‡¶ø‡¶∑‡ßü‡ßá ‡¶Ö‡¶®‡¶æ‡¶∞‡ßç‡¶∏ ‡¶ï‡ßã‡¶∞‡ßç‡¶∏ ‡¶ö‡¶æ‡¶≤‡ßÅ ‡¶π‡ßü‡•§ ‡¶â‡¶ï‡ßç‡¶§ ‡¶∏‡¶Æ‡ßü‡ßá ‡¶∞‡¶∏‡¶æ‡ßü‡¶® ‡¶¨‡¶ø‡¶≠‡¶æ‡¶ó‡ßá‡¶∞ ‡¶¨‡¶ø‡¶≠‡¶æ‡¶ó‡ßÄ‡ßü ‡¶™‡ßç‡¶∞‡¶ß‡¶æ‡¶® ‡¶õ‡¶ø‡¶≤‡ßá‡¶® ‡¶ú‡¶®‡¶æ‡¶¨ ‡¶Æ‡ßã‡¶É ‡¶ì‡ßü‡¶æ‡¶ú‡ßá‡¶¶ ‡¶Ü‡¶≤‡ßÄ‡•§ ‡¶ú‡¶æ‡¶§‡ßÄ‡ßü ‡¶¨‡¶ø‡¶∂‡ßç‡¶¨‡¶¨‡¶ø‡¶¶‡ßç‡¶Ø‡¶æ‡¶≤‡ßü ‡¶ö‡¶æ‡¶≤‡ßÅ ‡¶π‡¶≤‡ßá ‡¶ú‡¶æ‡¶§‡ßÄ‡ßü ‡¶¨‡¶ø‡¶∂‡ßç‡¶¨‡¶¨‡¶ø‡¶¶‡ßç‡¶Ø‡¶æ‡¶≤‡ßü‡ßá‡¶∞ ‡¶Ö‡¶ß‡ßÄ‡¶®‡ßá ‡¶Ö‡¶®‡¶æ‡¶∞‡ßç‡¶∏ ‡¶ï‡ßã‡¶∞‡ßç‡¶∏ ‡¶ö‡¶æ‡¶≤‡ßÅ ‡¶π‡ßü‡•§ ‡¶¢‡¶æ‡¶ï‡¶æ ‡¶¨‡¶ø‡¶∂‡ßç‡¶¨‡¶¨‡¶ø‡¶¶‡ßç‡¶Ø‡¶æ‡¶≤‡ßü‡ßá‡¶∞ ‡¶Ö‡¶ß‡ßÄ‡¶®‡ßá ‡¶Æ‡¶æ‡¶∏‡ßç‡¶ü‡¶æ‡¶∞‡ßç‡¶∏ ‡¶ï‡ßã‡¶∞‡ßç‡¶∏ ‡¶ö‡¶æ‡¶≤‡ßÅ ‡¶õ‡¶ø‡¶≤‡¶®‡¶æ‡•§ 1993 ‡¶∏‡¶æ‡¶≤‡ßá ‡¶ú‡¶æ‡¶§‡ßÄ‡ßü ‡¶¨‡¶ø‡¶∂‡ßç‡¶¨‡¶¨‡¶ø‡¶¶‡ßç‡¶Ø‡¶æ‡¶≤‡ßü‡ßá‡¶∞ ‡¶Ö‡¶ß‡ßÄ‡¶®‡ßá ‡¶Æ‡¶æ‡¶∏‡ßç‡¶ü‡¶æ‡¶∞‡ßç‡¶∏ ‡¶ï‡ßã‡¶∞‡ßç‡¶∏ ‡¶ö‡¶æ‡¶≤‡ßÅ ‡¶π‡ßü‡•§</p>', 'public/uploads/media-gallery/1637812117.jpg', 'public/uploads/featured_image/01-1642853126.jpg', NULL, '2021-11-27 00:01:19', '2022-01-22 23:05:26'),
(2, NULL, 'page', 'Welcome Page', 'welcome-page', '<p>Ananda Mohan College, Mymensingh is one of the renowned college in Bangladesh. It was established 1901. Ananda Mohan Bose established this Institution in 1883 in his own family residence at Ram Babu Road. This institution was later renamed City Collegiate School. On 18 July 1901, it introduced a college branch as an affiliate of the Calcutta City College established by the Brahmo Samaj. The college section was closed in 1906 after the death of Ananda Mohan Basu. Two years later, Mr. Blackwood, the district magistrate of Mymensingh took an initiative to reopen the college. In the process, the college was renamed Ananda Mohan College. Professor Baikuntha Kishor Chakravarty was appointed its first principal. The college was affiliated with Calcutta University till 1947.</p>', '', 'public/uploads/media-gallery/1637812122.jpg', NULL, '2021-11-27 02:18:25', '2022-01-12 11:18:26'),
(3, 2, 'department', 'Tset', 'tset', '<p>Ananda Mohan College is one of the distinctive institutions in Bangladesh. The college was established in 1908 during the time of British-India. The college is named after Ananda Mohan Bose, who was a man of great reputation. Not only a Barrister, he was also a politician and a social reformer. Maulavi Hamid Uddin Ahmed who was the first Muslim graduate in Mymensingh district and a classmate of Ananda Mohan Bose donated the most part of land for college and proposed to name the college after his friend, Ananda Mohan Bose. Since 1908 the college has achieved the dignity of a first grade college in the country till date. As the intellectuals, scholars and learned teachers enlighted the institution</p>', 'public/uploads/media-gallery/1637812111.jpg', 'public/uploads/media-gallery/1637812111.jpg', '2021-11-29 05:27:30', '2021-11-27 23:17:34', '2021-11-29 05:27:30'),
