(23, 20, 'department', 'Management', 'management', '<p>The Management Department, as it stands now, has a long history. The Department of Management was established under the Faculty of Commerce of the Dhaka University. This Department emerged as an independent Faculty in 1973. The Masters program was introduced in Management Department in the session 1989-90 under Dhaka University. In view of the utmost importance of business education, the department of management was floated under the commerce faculty.The Faculty of Commerce was renamed as the Faculty of Business Studies in 2001. During 2001-2002, the names of the B.Com. (Hons.) and M.Com degrees were changed to BBS and MBS degrees respectively. From the same academic session, the 4-year BBS Program was introduced in place of 3-year B.COM. The one-year M.COM Program was also renamed as MBS Program. The department offers an enjoyable teaching-learning environment, which has been made possible by the existence of some unique physical and related facilities. The facilities include: A well-equipped adequate lighting, in-built microphone system in all classrooms, sophisticated overhead and multimedia projectors for visual presentation using computers.<br />\r\n<br />\r\nThe main objective of the Department of Management Studies is to provide professional knowledge and skills in Management with a view to enhancing the efficiency and effectiveness of managerial manpower in business andnon-business organizations to face the emerging challenges in the competitive world of the new millennium.</p>\r\n\r\n<table class=\"table table-bordered\">\r\n	<tbody>\r\n		<tr>\r\n			<th colspan=\"4\">Teacher&#39;s statistic</th>\r\n		</tr>\r\n		<tr>\r\n			<th>Designation</th>\r\n			<th>Total post</th>\r\n			<th>Active</th>\r\n			<th>Vacancy</th>\r\n		</tr>\r\n		<tr>\r\n			<td>Professor</td>\r\n			<td>1</td>\r\n			<td>1</td>\r\n			<td>0</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Associate professor</td>\r\n			<td>3</td>\r\n			<td>4</td>\r\n			<