(28, 18, 'department', 'Political Science', 'political-science', '<p>Brief History of the Department Head of the Department : Professor Md. Syedur Rahman, M.Phil Political Science Department started in the session 1990-91 pioneered by Mr. Abdus Salam , its first Head. Over the course of the time the Department is at present one of the largest Departments of Ananda Mohan College. The Department accommodates almost 2230 students among them 1080 in graduate, 700 in Masters Preliminary, and 650 in Masters Final Year including private candidates. The Department with as many as 12 teachers offers specialized education in almost all the branches of Political Science. The major areas involve Bangladesh Politics, International Relations, Political Thoughts in East and West, Politics in the Middle East and East Asia and Governance Studies, Development politics, Women studies public administration, Local government &amp; politics. The department offers a four-year Bachelor of Social Sciences (BSS) and one-year Master of Social Sciences (MSS) program. A substantial number of scholars of international reputation, political leaders, leading bureaucrats and civil society members are the ex-students of the Department of Political Science. The Department has a high profile Curriculum and Development Committee which makes sure that the academic curriculums of all the program be updated enough to address the recent national and international issues concerned. The Department offers unique opportunity for its students to consult with teachers year-wise Advisors on diversified issues. It offers computer and Internet facilities for teachers and students as well. To ensure quality education department provides a considerable amount of books journals, informative documents for teachers &amp; students. Recently department arranged the projectors facility in classroom for digitalization. Department compulsorily arranged Bangla &amp;English daily newspapers for the students in seminar room.</p>\r\n\r\n<table class=\"table table-bordered\">\r\n	<tbody>\r\n		<tr>\r\n			<th colspan=\"4\">Teacher&#39;s statistic</th>\r\n		</tr>\r\n		<tr>\r\n			<th>Designation</th>\r\n			<th>Total post</th>\r\n			<th>Active</th>\r\n			<th>Vacancy</th>\r\n		</tr>\r\n		<tr>\r\n			<td>Professor</td>\r\n			<td>01</td>\r\n			<td>01</td>\r\n			<td>0</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Associate professor</td>\r\n			<td>03</td>\r\n			<td>02</td>\r\n			<td>1</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Assistant professor</td>\r\n			<td>04</td>\r\n			<td>02</td>\r\n			<td>2</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Lecturer</td>\r\n			<td>04</td>\r\n			<td>04</td>\r\n			<td>0</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table class=\"table table-bordered\">\r\n	<tbody>\r\n		<tr>\r\n			<th colspan=\"4\">Student&#39;s statistic</th>\r\n		</tr>\r\n		<tr>\r\n			<th>Class</th>\r\n			<th>Student (Male)</th>\r\n			<th>Student (Female)</th>\r\n			<th>Total</th>\r\n		</tr>\r\n		<tr>\r\n			<td>Honour&#39;s</td>\r\n			<td>620</td>\r\n			<td>634</td>\r\n			<td>1254</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Master&#39;s</td>\r\n			<td>595</td>\r\n			<td>712</td>\r\n			<td>1307</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, NULL, NULL, '2021-11-30 04:12:35', '2021-11-30 04:12:35'),
