(1, '2021-11-27', 2, 'Ananda Mohan College News', 'ananda-mohan-college-news', '<p>Ananda Mohan College is one of the distinctive institutions in Bangladesh. The college was established in 1908 during the time of British-India. The college is named after Ananda Mohan Bose, who was a man of great reputation. Not only a Barrister, he was also a politician and a social reformer. Maulavi Hamid Uddin Ahmed who was the first Muslim graduate in Mymensingh district and a classmate of Ananda Mohan Bose donated the most part of land for college and proposed to name the college after his friend, Ananda Mohan Bose. Since 1908 the college has achieved the dignity of a first grade college in the country till date. As the intellectuals, scholars and learned teachers enlighted the institution</p>', 'public/uploads/featured_image/00-1642075014.jpg', NULL, 'publish', '2022-01-18 02:07:16', '2021-11-27 02:37:02', '2022-01-18 02:07:16'),
(2, '2021-11-28', 3, 'Test Ananda Mohan College News', 'test-ananda-mohan-college-news', '<p>Ananda Mohan College is one of the distinctive institutions in Bangladesh. The college was established in 1908 during the time of British-India. The college is named after Ananda Mohan Bose, who was a man of great reputation. Not only a Barrister, he was also a politician and a social reformer. Maulavi Hamid Uddin Ahmed who was the first Muslim graduate in Mymensingh district and a classmate of Ananda Mohan Bose donated the most part of land for college and proposed to name the college after his friend, Ananda Mohan Bose. Since 1908 the college has achieved the dignity of a first grade college in the country till date. As the intellectuals, scholars and learned teachers enlighted the institution</p>', 'public/uploads/media-gallery/1637812117.jpg', NULL, 'publish', '2022-01-18 02:07:20', '2021-11-28 00:21:11', '2022-01-18 02:07:20'),
