(10, '2022-01-26', 1, 'Former Professor Azizur Rahman passed away today on 12/01/2022', 'former-professor-azizur-rahman-passed-away-today-on-12/01/2022', '<p>Azizur Rahman, former professor of Bangla Department of this college passed away today on 12/01/2022 (Inna Lillahi Wa Inna Ilahi Raziun). The Anand Mahen College family is deeply saddened by his death. We seek the forgiveness of the soul of the deceased to the Most Merciful God and extend our deepest sympathies to the bereaved family.</p>', 'public/uploads/featured_image/images-1642480847-1643187664.png', NULL, 'publish', NULL, '2022-01-26 20:01:04', '2022-01-26 20:01:04'),
