INSERT INTO `speeches` (`id`, `department_id`, `designation_id`, `name`, `slug`, `title`, `description`, `avatar`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 1, 1, 'Prof. Md. Aman Ullah', 'principal\'s-speech-1638269022', 'Principal\'s Speech', '<p>Ananda Mohan College is one of the distinctive institutions in Bangladesh. The college was established in 1908 during the time of British-India. The college is named after Ananda Mohan Bose, who was a man of great reputation. Not only a Barrister, he was also a politician and a social reformer.</p>\r\n\r\n<p>Maulavi Hamid Uddin Ahmed who was the first Muslim graduate in Mymensingh district and a classmate of Ananda Mohan Bose donated the most part of land for college and proposed to name the college after his friend, Ananda Mohan Bose.</p>\r\n\r\n<p>Since 1908 the college has achieved the dignity of a first grade college in the country till date. As the intellectuals, scholars and learned teachers enlighted the institution, the students of this institution contributed much in national and international arena. Radhabinod Pal, a lecturer in Mathematics of Ananda Mohan College become the justice of Nuremburg tribunal in the 2nd World War. Syed Nazrul Islam, the first acting President of Bangladesh was a teacher of History Department at Ananda Mohan College; Prof. Kabir Chowdury and so many famous teachers served the college. Like others, the famous poet Nirmalendu Goon, renowned intellectual and writer Jatin Sarker, Jyotirmoy Guhathakurta , a martyred intellectual were the students of Ananda Mohan College.</p>\r\n\r\n<p>It is needless to say that Ananda Mohan College has been the part of glorious history in thriving education and culture from British-India to independent Bangladesh.</p>\r\n\r\n<p>I convey my gratitude to the first Principal of Ananda Mohan College Mr. Baikuntha Kishor Chakravarty and Mr. JR Black Wood, the then district magistrate of Mymensingh and Jamindars who organized and raised the fund in establishing the college.</p>\r\n\r\n<p>I remember with great respect the father of the nation Bangabandhu Sheikh Mujibur Rahman and the freedom fighters of the liberation war of Bangladesh. The students, teachers and staff of Ananda Mohan College altogether try to make true the dream of father of the nation&nbsp;<strong>&lsquo;The Sonar Bangla&rsquo;</strong>&nbsp;by their efforts. Thanks to all.</p>\r\n\r\n<h3><strong>Prof. Md. Aman Ullah</strong></h3>\r\n\r\n<p>Principal</p>\r\n\r\n<p>Ananda Mohan College</p>\r\n\r\n<p>Mymensingh</p>', 'public/uploads/speech/01-1638072463.png', NULL, '2021-11-27 21:13:13', '2021-11-30 04:43:42'),
(2, 1, 2, 'Prof. Md. Nurul Afsar', 'vice-principal\'s-speech-1641961774', 'Vice Principal\'s Speech', '<p>Welcome to Ananda Mohan College, Mymensingh. Topographically the college is located at the heart of Mymensingh city, not too far from old Brahmaputra river. It was established in 1908. The College has been imparting quality education with repute from Higher Secondary to Masters&rsquo; level since its inception. We are happy to inform our friends and well wishers at home and abroad that Ananda Mohan College is globally connected through website. The website has ushered a new era in the history of Ananda Mohan College. It paved the way for the modernization of the college. Unlike the earlier forms of instructional technology, the website is likely to play a significant role in promoting higher education. In a world growing smaller every day, the technological reformations are essential both for the spread of education and to foster a spirit of friendship and cooperation. The world has formed a family whose members are now able to communicate to each other in a free and frank manner because of this technological bonanza. The website has made various types of services available to the students as well as to the public. Now one may click to know the brief history of the college, to collect admission form, notices, results, advertisement and even to know the profile of the teacher and other relevant information regarding institutional affairs.</p>\r\n\r\n<p>Our Honorable Prime Minister Sheikh Hasina, the champion of democracy is committed to build a digital Bangladesh. Our premier&rsquo;s &lsquo;Digital Bangladesh&rsquo; has a human connotation where man will not turn into a machine rather technological weapons such as Computers, Notepad, Laptop, Smartphone etc. are a means to an &ldquo;end&rdquo; and the &ldquo;end&rdquo; is a technologically rich Bangladesh, a poverty free Bangladesh, a Democratic Bangladesh where the public servant will render service effectively and at low cost to our millions. Such Bangladesh will be a real &lsquo;Sonar Bangla&rsquo; that our Father of the Nation has dreamt.</p>\r\n\r\n<p>I am pleased that the website has become the focal point of all academic activities of Ananda Mohan College. I take this opportunity to congratulate all who have contributed meaningfully for the establishment of this unique event in the history of this college.</p>\r\n\r\n<h3><strong>Prof. Md. Nurul Afsar</strong></h3>\r\n\r\n<p>Vice Principal</p>\r\n\r\n<p>Ananda Mohan College</p>\r\n\r\n<p>Mymensingh, Bangladesh</p>', 'public/uploads/speech/00-1638268990.png', NULL, '2021-11-27 22:02:50', '2022-01-12 04:29:34');
